/**
 * @param {string} name
 * @returns {any}
 */
export function get(name: string): any;
/**
 * @param {string} name
 * @param {any} value
 * @returns {void}
 */
export function set(name: string, value: any): void;
/**
 * @param {string} name
 * @returns {boolean}
 */
export function has(name: string): boolean;
